INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1.4, 0, "お！\nあそこに困ってそうな人発見！", 1001, 1, "春咲 ひより", 1, 2, 0, 0, 0, 1, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "わ、わたし、\nなに言ってるんだろ\nあはは…", 1.4, 0, "大切な人を\n守れるようになりたい…って", 1002, 1, "草野 優衣", 1, 2, 0, 0, 0, 1, "みんなみたいに\nわたしも強くならなきゃ");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "少しは磨かれると思いますよ。", 1.4, 0, "キミに必要な集中力と感性が", 1003, 1, "士条 怜", 1, 2, 0, 0, 0, 1, "フェンシングを始めてみては？");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "みそぎはねぇ、\nかくれんぼやりたい！", 1.5, 0, "今日はなにして遊ぶ？", 1004, 1, "穂高 みそぎ", 1, 2, 0, 0, 0, 1, "ねぇ、にいちゃん！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "私といっしょに…\nいかない？", 1.4, 0, "ねぇ…", 1006, 1, "風宮 あかり", 1, 2, 0, 0, 0, 1, "風宮あかりです");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "食べ物の恨みは怖いのー", 1.5, 0, "プリンたべたいのー", 1007, 1, "出雲 宮子", 1, 2, 0, 0, 0, 1, "出雲宮子なのー");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "いいよ。\n見られることは運命さ…", 1.4, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", 1008, 1, "虹村 雪", 1, 2, 0, 0, 0, 1, "ボクは虹村雪。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "人呼んで「疾風の冥姫」!!", 1.4, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1009, 1, "柊杏奈", 1, 2, 0, 0, 0, 1, "フッ…聞いて後悔するがいい！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "ほんまおおきにやわ～♪", 1.5, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1010, 1, "姫宮 真歩", 1, 2, 0, 0, 0, 1, "マホマホ王国のプリンセス、\nまほ姫どす");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "ここで会ったが\n100年目～！", 1.4, 0, "生き別れたお兄ちゃんを探して\n三千世界！", 1011, 1, "衣之咲 璃乃", 1, 2, 0, 0, 0, 1, "衣之咲璃乃です！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "…って、お願い！\n誰にも言わないでおいて～！", 1.4, 0, "ち、超能力って…\n何のことかな～？", 1012, 1, "柏崎 初音", 1, 2, 0, 0, 0, 1, "私はハツネ、\n結構強いんだよ。\nきらーん☆");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1.4, 0, "一応カリスマ読モJKやってまっす！", 1016, 1, "美波 鈴奈", 1, 2, 0, 0, 0, 1, "ちょす！\n美波鈴奈だよ～♪");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "でも、沖縄もとってもいいとこさー", 1.4, 0, "東京は遊園地みたいなところさー", 1017, 1, "喜屋武 香織", 1, 2, 0, 0, 0, 1, "はいたーい。\n喜屋武香織さー。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "イオちゃんって呼んでね。", 1.4, 0, "先生って呼ばれるのは\nくすぐったいから", 1018, 1, "支倉 伊緒", 1, 2, 0, 0, 0, 1, "支倉伊緒です。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "ミミをおいてかないでぇ～", 1.5, 0, "あ！/\お兄ちゃ～ん\nまってよ～", 1020, 1, "茜 ミミ", 1, 2, 0, 0, 0, 1, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "ふぇぇぇぇぇん……", 1.5, 0, "あの……\nふぇ……", 1021, 1, "栗林 くるみ", 1, 2, 0, 0, 0, 1, "あ…あの…えっと…\n栗…林…くるみ…です……");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "なんてありがとうございます！", 1.4, 0, "こんな私に貴重な時間を\n割いていただき、", 1022, 1, "風宮 より", 1, 2, 0, 0, 0, 1, "風宮よりです。\nあああああ！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "私こっち行きたいー\nね、早く早くー", 1.5, 0, "おにいちゃんどこいくの？\nえ？", 1023, 1, "北条 綾音", 1, 2, 0, 0, 0, 1, "私、アヤネ！\nぷうきちと一緒についてってあげるね！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "これて何か違う…\nあああすみません！", 1.4, 0, "ふ、不束者ですが\nどうぞ末永く…って、", 1025, 1, "天野 すずめ", 1, 2, 0, 0, 0, 1, "わっ…わっ…私、\n天野すずめといいます！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "離しませんわ………\n絶対に…!!", 1.4, 0, "あなたは…運命の……\n伴侶……", 1027, 1, "倉石 恵理子", 1, 2, 0, 0, 0, 1, "……クスクス…私は\n…倉石恵理子……");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "…そうでしょ？？", 1.4, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1028, 1, "佐々木 咲恋", 1, 2, 0, 0, 0, 1, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "あはは、\n私もまだまだだなぁ～", 1.4, 0, "ぇっと…\nキミ、私のこと知らないの?!", 1029, 1, "桜井 望", 1, 2, 0, 0, 0, 1, "桜井望だよ！\nよろしくねっ");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "ショーグン、\nワタシと一緒に天下統一デース！", 1.4, 0, "初めまして、\n私はニノン・ジュベール申すデス！", 1030, 1, "ニノン・ジュベール", 1, 2, 0, 0, 0, 1, "デケデケデンっ！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "おかしいですね……", 1.4, 0, "でもって私の隣にいるのが……\nえ、見えない？", 1031, 1, "上喜 しのぶ", 1, 2, 0, 0, 0, 1, "上喜しのぶです。\n手元のドクロが父です。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "そう、\nオラのボケに突っ込める相方が…！", 1.5, 0, "けんども\nそれには足りないモンが…", 1033, 1, "野戸まひる", 1, 2, 0, 0, 0, 1, "目指すはビッグな\nお笑い芸人だっぺ！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "ちょ\nちょっと一杯飲んできます…！", 1.4, 0, "ちょっと緊張しちゃって…", 1034, 1, "綾瀬 ゆかり", 1, 2, 0, 0, 0, 1, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "これ以上お話しすることは…\nないです！", 1.5, 0, "知らない人とは話しちゃいけないので", 1036, 1, "氷川 鏡華", 1, 2, 0, 0, 0, 1, "氷川鏡華…です");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1.4, 0, "……あ、アラーム。", 1038, 1, "柏崎 栞", 1, 2, 0, 0, 0, 1, "柏崎…栞です。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "野に咲く花が、\n唯一の話相手です。", 1.4, 0, "私、一人も友達がいなくて……", 1040, 1, "双葉 碧", 1, 2, 0, 0, 0, 1, "ふ、双葉碧です。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "そう思っています。", 1.4, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1042, 1, "三角 千歌", 1, 2, 0, 0, 0, 1, "三角千歌です。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "う、疑ってすまなかったな…", 1.4, 0, "あぁ？\nお前のそいつの仲間か？", 1043, 1, "安芸 真琴", 1, 2, 0, 0, 0, 1, "安芸真琴だ。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1.4, 0, "生けとし生ける全ての者よ！", 1044, 1, "イリヤ・オーンスタイン", 1, 2, 0, 0, 0, 1, "わらわこそは夜を総べる者！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "ｌク、クウカに何かご用ですか!?", 1.4, 0, "ぐふふふふ……はっ！", 1045, 1, "遠見 空花", 1, 2, 0, 0, 0, 1, "そこで騎士は妖精を乱暴に……");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "う～ん…\n猫ってホントに最高にゃ～♪", 1.4, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1046, 1, "宮坂たまき", 1, 2, 0, 0, 0, 1, "宮坂たまきにゃ♪\n猫はいいにゃよ？");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1.4, 0, "それでは早速クエストに…", 1048, 1, "大神 美冬", 1, 2, 0, 0, 0, 1, "大神美冬よ！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1.4, 0, "クエストもバトルも\n掃除も洗濯も", 1049, 1, "星野静流", 1, 2, 0, 0, 0, 1, "星野静流だよ！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1.5, 0, "見ての通りの\nセクシー美少女で", 1050, 1, "玉泉美咲", 1, 2, 0, 0, 0, 1, "アタシは玉泉美咲。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "？？？？", 1.4, 0, "？？？？", 1052, 1, "リマ", 1, 2, 0, 0, 0, 1, "？？？");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "そ、そこまでいうなら\nもらってやる", 1.5, 0, "菓子でつろうなどと\n稚拙な策を……", 1053, 1, "モニカ・ヴァイスヴィント", 1, 2, 0, 0, 0, 1, "モニカ・ヴァイスヴィントだ。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "そ、そこまでいうなら\nもらってやる", 1.5, 0, "菓子でつろうなどと\n稚拙な策を……", 1058, 1, "ペコリーヌ", 1, 2, 0, 0, 0, 1, "モニカ・ヴァイスヴィントだ。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "そ、そこまでいうなら\nもらってやる", 1.5, 0, "菓子でつろうなどと\n稚拙な策を……", 1059, 1, "コッコロ", 1, 2, 0, 0, 0, 1, "モニカ・ヴァイスヴィントだ。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, "そ、そこまでいうなら\nもらってやる", 1.5, 0, "菓子でつろうなどと\n稚拙な策を……", 1060, 1, "キャル", 1, 2, 0, 0, 0, 1, "モニカ・ヴァイスヴィントだ。");
